import React, { useState } from "react";

const Test = () => {
  const [element1, setElement1] = useState("Hello World");
  const handleSubmit = e => {
    console.log(e);
  };
  return (
    <React.Fragment>
      <h1>{element1}</h1>
      <input type="text" onSubmit={() => handleSubmit(e)}>
        Enter your name?
      </input>
    </React.Fragment>
  );
};

export default Test;
